import React from 'react';


import Tuscany from '../DB/Tuscany.json';

export default function SpecificTour () {

    const { id } = useParams();
    const [Tuscany, setTuscany] = useState(null);
  
    useEffect(() => {
      // Fetch tour data based on id (replace with your API call logic or context filtering)
      const foundTour = Tuscany.find((Tuscany)=> Tuscany.id === id)
      setTuscany(foundTour);
    }, [id]);
  
    if (!Tuscany) return <p>Loading...</p>;
    return(
        <section key={Tuscany.id}>
           {Tuscany.title}
        </section>
    )
}
